import React from 'react';
import logo from '../../logo.svg';
import { Header }  from '../Header/Header';
import { Gizmos }  from '../Gizmos/gizmos';
import './App.css';

function App() {
  return (
    <div className="app">
      <Header />
      <Gizmos />
    </div>
  );
}

export default App;
